  return (
    <Router>
      <div className="App">
      <Link className="nav-link" to={"/create-user"}>Create User</Link>
      <Link className="nav-link" to={"/create-user"}>Create User</Link>
        <Routes>
          <Route exact path='/'><Form /></Route>
